import React, { useEffect, useState } from "react";
import { getOrders, updateOrderStatus } from "../../api";

export default function StaffOrders() {
  const [orders, setOrders] = useState([]);
  const [errorMsg, setErrorMsg] = useState("");
  const [selectedOrder, setSelectedOrder] = useState(null);

  useEffect(() => {
    getOrders().then(setOrders).catch(() => setErrorMsg("Failed to load orders."));
  }, []);

  const handleStatusChange = async (orderId, status) => {
    try {
      await updateOrderStatus(orderId, status);
      setOrders(orders =>
        orders.map(o => o.id === orderId ? { ...o, status } : o)
      );
    } catch {
      setErrorMsg("Failed to update order status.");
    }
  };

  return (
    <div>
      <h2>Order Management</h2>
      {errorMsg && <div style={{ color: "red" }}>{errorMsg}</div>}
      <table border="1" cellPadding="8" style={{ width: "100%", marginTop: 16 }}>
        <thead>
          <tr>
            <th>Order ID</th>
            <th>Customer</th>
            <th>Status</th>
            <th>Update Status</th>
            <th>Details</th>
          </tr>
        </thead>
        <tbody>
          {orders.map(order => (
            <tr key={order.id}>
              <td>{order.id}</td>
              <td>{order.customerName || order.customer?.name}</td>
              <td>{order.status}</td>
              <td>
                <select
                  value={order.status}
                  onChange={e => handleStatusChange(order.id, e.target.value)}
                >
                  <option value="PENDING">PENDING</option>
                  <option value="PROCESSING">PROCESSING</option>
                  <option value="SHIPPED">SHIPPED</option>
                  <option value="DELIVERED">DELIVERED</option>
                  <option value="CANCELLED">CANCELLED</option>
                </select>
              </td>
              <td>
                <button onClick={() => setSelectedOrder(order)}>View</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* Order details modal */}
      {selectedOrder && (
        <div style={{
          position: "fixed", top: 0, left: 0, width: "100vw", height: "100vh",
          background: "rgba(0,0,0,0.3)", display: "flex", alignItems: "center", justifyContent: "center", zIndex: 9999
        }}>
          <div style={{
            background: "#fff", padding: "2rem", borderRadius: "12px", minWidth: "400px", maxWidth: "480px", boxShadow: "0 2px 16px rgba(0,0,0,0.15)", position: "relative"
          }}>
            <button style={{ position: "absolute", top: 8, right: 12 }} onClick={() => setSelectedOrder(null)}>✕</button>
            <h3>Order Details</h3>
            <pre>{JSON.stringify(selectedOrder, null, 2)}</pre>
          </div>
        </div>
      )}
    </div>
  );
}
